try {
/* module-key = 'com.appfusions.confluence.federated-search:search-tabs', location = 'includes/init.js' */
appfusions = (window || this).appfusions || {};
appfusions.confluence = appfusions.confluence || {};
appfusions.confluence.fedsearch = (function() {
    var getCurrentPage = function(startResult, itemsPerPage) {
        return 1+(startResult -1)/itemsPerPage;
    };

    var getPreviousPage = function(startResult, itemsPerPage) {
        return startResult < itemsPerPage ? 0 : getCurrentPage(startResult, itemsPerPage) - 1;
    };

    var getNextPage = function(startResult, itemsPerPage, totalResults) {
        return startResult-1 + itemsPerPage > totalResults
            ? 0
            : getCurrentPage(startResult, itemsPerPage) + 1;
    };

    var getTotalPages = function(itemsPerPage, totalResults) {
        return Math.ceil(totalResults/itemsPerPage);
    };

    var getFileIconType = function(extension, badge) {
        var extLow = extension.toLowerCase();
        
        return badge + '-icon-file-' + extLow;
    };

    var editInOffice = function(extension) {
        var extLow = extension.toLowerCase();
        return extLow == 'doc' || extLow == 'docx' || extLow == 'ppt' || extLow == 'pptx'
            || extLow == 'xls' || extLow == 'xlsx';
    };

    var setupPreview = function () {
    	/*
        AJS.$("a.appfusions-fedsearch-preview").each(function() {
        	var $self = AJS.$(this);
            if ($self.hasClass("appfusions-fedsearch-image")) {
                $self.fancybox({ type: 'image',  titleShow: false });
            } else {
                $self.fancybox({ type: 'iframe', titleShow: false, width: 710, height: 650 });
            }
        });
        */
    };

    var setupMetaDataDialog = function (entries) {
        for (i = 0; i < entries.length; i++) {
        	AJS.$('a.appfusions-fedsearch-metadata' + i).click(function(entry) {
                return function(event) {
                	event.preventDefault();
                    var $self = AJS.$(this);
                    var metaData = [];
                    for (var key in entry.meta) {
                        metaData.push({ key: key, value: entry.meta[key]})
                    }
                    var data = {
                        title: $self.attr('data-title'),
                        path: $self.attr('data-path'),
                        metaData: metaData
                    }
                    var metaDataDialogTemplate = Confluence.Templates.FederatedSearch.metadataDialog(data);
                    var dialog = new AJS.Dialog({
                        width: 600,
                        height: 250,
                        id: 'appfusions-fedsearch-metadata-dialog-' + $self.attr('data-docid'),
                        closeOnOutsideClick: true
                    });
                    dialog.addPanel("Panel", metaDataDialogTemplate, "panel-body");

                    dialog.addButton("OK", function (dialog) {
                        dialog.hide();
                    });
                    dialog.show();
                };
            }(entries[i]));
        }
    };
    
    var publishEvent = function(event) {
    	AJS.$.event.trigger(event);
    }

    var performSearch = function(haystack, pageNo) {
    	var q = AJS.$('#query-string').val();
        var url = AJS.params.baseUrl + haystack.source + '?q=' + q + '&p=' + pageNo;
        var searchPane = AJS.$('#appfusions-fedsearch-pane-' + haystack.fragment);
        var searchResultsPane = searchPane.find('.appfusions-fedsearch-results-wrapper');
        var blanket = searchPane.find('.appfusions-fedsearch-blanket');
        var errorPane = searchPane.find('.aui-message').show();
        
        AJS.log(' ++ restUrl: ' + url);
        AJS.$.ajax({
            url: url,
            beforeSend: function() {
            	errorPane.hide();
                blanket.show();            
            },
            success: function(data) {
                var badge = AJS.$('#appfusions-fedsearch-link-' + haystack.fragment + ' span.aui-badge');
                badge.text(data.totalResults);
                badge.show();

                for (i=0; i < data.entries.length; i++) {
                    data.entries[i].pubDate = AJS.$.datepicker.formatDate('M d, yy', new Date(data.entries[i].pubDate));
                    //var extension = data.entries[i].fileName.split('.').pop();
                    var extension = data.entries[i].fileType;
                    
                    data.entries[i].fileIconType = getFileIconType(extension, haystack.fragment);
                    data.entries[i].editInOffice = editInOffice(extension);
                }

                var params = {
                    query:        AJS.$('#query-string').val(),
                    totalResults: data.totalResults,
                    entries:      data.entries,
                    totalPages:   getTotalPages(data.itemsPerPage, data.totalResults),
                    currentPage:  getCurrentPage(data.startIndex, data.itemsPerPage),
                    previousPage: getPreviousPage(data.startIndex, data.itemsPerPage),
                    nextPage:     getNextPage(data.startIndex, data.itemsPerPage, data.totalResults)
                }
                var resultTemplate = Confluence.Templates.FederatedSearch.searchResult(params);
                searchResultsPane.empty().append(resultTemplate);

                setupPreview();
                setupMetaDataDialog(data.entries);

                // pagination
                searchPane.find('.appfusions-fedsearch-pagination a').click(function(event) {
                    event.preventDefault();
                    performSearch(haystack, AJS.$(this).attr('data-page'));
                });
            },
            complete: function() {
                blanket.hide();
                
                publishEvent({
                	type: 	  		"searchCompleted",
                	haystack: 		haystack,
                	previewLink:	"appfusions-fedsearch-preview",
                	editLink:		"appfusions-fedsearch-edit"
                });
            },
            error: function(jqXHR, errorType, exception) {
                AJS.log(' +++ Error in $.ajax search');
                
                searchResultsPane.empty();
                errorPane.children("span.warning-message").empty().append(jqXHR.responseText);
                errorPane.show();
            }
        });
    };

    return {
        // public members
        search: performSearch
    }
})();

/* ------------------------------------------------------------------------------------------------------------------ */
// Initialisation
/* ------------------------------------------------------------------------------------------------------------------ */
AJS.toInit(function () {
    // Used to determine if a string ends with a given suffix
    String.prototype.endsWith = function(suffix) {
        return this.indexOf(suffix, this.length - suffix.length) !== -1;
    };

    var hideBadges = function() {
        AJS.$('#appfusions-fedsearch-tab-container .aui-nav span.aui-badge').each(function() {
            AJS.$(this).hide();
        });
    };

    // If the search term is changed, we need to refresh the results; and we do that
    // by programmatically clicking on the active tab.
    AJS.$('#search-form').submit(function(event) {
        hideBadges();
        _.delay(function() {
            var selectedItem = AJS.$('#appfusions-fedsearch-tab-container > .aui-navgroup li.aui-nav-selected');
            selectedItem.children('a').first().click();
        }, 1000);
    });

    /**
     * @param paneId a string that is the id of the pane that needs to be refreshed
     */
    var refreshPaneContents = function(paneId, haystack) {
        var searchTerm = AJS.$('#query-string').val();
        var dataTerm = AJS.$(paneId).find('.appfusions-fedsearch-results').attr('data-term');
        if (dataTerm != searchTerm) {
            appfusions.confluence.fedsearch.search(haystack, 1);
        }
    };

    var swapTabs = function(clickedLink) {
        var selectedItem = AJS.$('#appfusions-fedsearch-tab-container > .aui-navgroup li.aui-nav-selected');
        var selectedPane = selectedItem.children('a').first().attr('href');

        var clickedItem = clickedLink.parent();
        var clickedPane = clickedLink.attr('href');

        // swap over the navigation items
        selectedItem.removeClass('aui-nav-selected');
        clickedItem.addClass('aui-nav-selected');

        // swap over the visible panes
        AJS.$(selectedPane).hide();
        AJS.$(clickedPane).show();
    };

    AJS.$(document).ajaxComplete(function(event) {
        if (/dosearchsite.action/.test(event.currentTarget.URL)) {
            var numResults = AJS.$('#appfusions-fedsearch-pane-confluence .search-results-count').attr('data-totalsize') || 0;
            var badge = AJS.$('#appfusions-fedsearch-link-confluence span.aui-badge');
            badge.text(numResults);
            badge.show();

            // the fadeOut in the Confluence code doesn't seem to work when its parent div is hidden
            AJS.$('#appfusions-fedsearch-pane-confluence .search-blanket').hide();
        }
    });

    var compareHaystacksByLabel = function(a,b) {
        if (a.label < b.label) {
            return -1;
        }
        if (a.label > b.label) {
            return 1;
        }
        return 0;
    };

    // Fetch the list of haystacks from the server
    AJS.$.ajax({
        url: AJS.params.contextPath + "/rest/appfusions/fedsearch/latest/haystack",
        success: function(data) {
            if (typeof data.haystacks == "undefined" || data.haystacks.length == 0) {
                return;
            }

            // Prepare the haystack data for access within the Soy template
            var haystacks = [];
            for (var i = 0; i < data.haystacks.length; i++) {
                haystacks.push({
                    label: data.haystacks[i].label,
                    source: data.haystacks[i].source,
                    fragment: data.haystacks[i].fragment
                });
            }

            haystacks.sort(compareHaystacksByLabel);

            // Apply the Soy template, and insert it into the right place on the page
            var searchTabsTemplate = Confluence.Templates.FederatedSearch.searchTabs({ haystacks: haystacks });
            var $searchResultsHeader = AJS.$('#search-results-header');
            var $searchResultsPanel = AJS.$('#search-results-header + div.aui-page-panel-inner');
            $searchResultsHeader.after(searchTabsTemplate);

            hideBadges();

            // move the Confluence search results into the correct tab
            AJS.$('#appfusions-fedsearch-pane-confluence').append($searchResultsPanel);

            // This function is run when AJS.tabs is first loaded, however it must also be run here because we
            // are using dynamically-generated tabs. It assigns click events to the tabs.
            AJS.tabs.setup();

            // Set up the functions that get applied when a user clicks on one of the tabs

            AJS.$('#appfusions-fedsearch-link-confluence').click(function(event) {
                event.preventDefault();
                swapTabs(AJS.$(this));
                
                // clear out the hash
                window.location.hash = '';
            });

            // When one of the tabs is clicked, we want to run a search against the corresponding haystack
            for (var i = 0; i < haystacks.length; i++) {
                var haystack = haystacks[i];
                AJS.$('#appfusions-fedsearch-link-' + haystack.fragment).click(function(haystack) {
                    return function(event) {
                        event.preventDefault();
                        var clickedLink = AJS.$(this);
                        var paneId = clickedLink.attr('href');
                        swapTabs(clickedLink);
                        refreshPaneContents(paneId, haystack);
                        
                        // modify the url to include the haystack fragment as a hash
                        window.location.hash = '#' + haystack.fragment;
                    };
                }(haystack));
            }

            // If the current window location url has a fragment, we programmatically
            // click the corresponding navigation tab, if there is one
            var hash = window.location.hash;
            hash = hash.replace("#", "");
            var initialTab = AJS.$('#appfusions-fedsearch-link-' + hash);
            
            if (initialTab.length > 0) {
                initialTab.click();
            }
        },
        error: function (x, status, error) {
            if (x.status == 403) {
                AJS.log(' +++ Error: Confluence session expired');
            } else {
                AJS.log(' +++ Federated search - Error in $.ajax search: ' + status + ' - ' + error);
            }
        }
    });
});
}catch(e){WRMCB(e)};
;
